import { render } from "react-dom";
import React from "react";

import AuthorQuiz from "./AuthorQuiz.js";

import "./bootstrap.min.css";

const authors = [
      {
            author:'Stephen King',
            imageUrl: 'img/',
            books:'The Shining',
      },
      {
            author:'George R. R. Martin',
            imageUrl: 'img/',
            books:'A Game of Thrones',
      },
]

render(<AuthorQuiz authors={authors} />, document.querySelector("#root"));
